        GENERATOR_INDEX__CONTRACT_ADDRESS,
        GENERATOR_INDEX__PARTIAL_ADDRESS,
        GENERATOR_INDEX__CONSTRUCTOR
    },
    hash::pedersen_hash,
    contract_class::ContractClassId,
    utils,
