use dep::std::cmp::Eq;
use crate::traits::{Empty, ToField, Serialize, Deserialize};
use crate::type_serialization::{ETH_ADDRESS_SERIALIZED_LEN, AZTEC_ADDRESS_SERIALIZED_LEN};

// Aztec address
struct AztecAddress {
    inner : Field
}

impl Eq for AztecAddress {
